import Link from 'next/link';


const Navbar = () => (

    <div>
        <ul>
        <li><link href = "/home"> <a> Home </a> </link> </li>
        <li><link href = "/about"> <a> Home </a> </link> </li>
        <li><link href = "/contact"> <a> Home </a> </link> </li>
        </ul>

    </div>

);

export default Navbar;
